function SPAIAdmin(){}SPAIAdmin.prototype.adjustSettingsTabsHeight=function(){var i=jQuery(".wp-shortpixel-ai-options section#tab-settings table").height()+80;i=Math.max(i,jQuery(".wp-shortpixel-ai-options section#tab-adv-settings table").height()+80);i=Math.max(i,jQuery("section#tab-resources .area1").height()+60);jQuery("#shortpixel-ai-settings-tabs").css("height",i);jQuery("#shortpixel-ai-settings-tabs section").css("height",i)};SPAIAdmin.prototype.switchSettingsTab=function(i){var e=jQuery("section#"+i);if(e.length>0){jQuery("section").removeClass("sel-tab");jQuery("section#"+i).addClass("sel-tab")}};SPAIAdmin.prototype.dismissNotice=function(i,e,t){jQuery("#short-pixel-ai-notice-"+e).hide();var s={action:"shortpixel_ai_dismiss_notice",notice_id:e,call:t};jQuery.get(i,s,function(i){s=JSON.parse(i);if(s["Status"]=="success"){console.log("dismissed");jQuery("#short-pixel-ai-success-"+e).show()}else{jQuery("#short-pixel-ai-notice-"+e).show();jQuery("#short-pixel-ai-notice-"+e+" .spai-action-error").css("display","inline-block")}})};window.ShortPixelAIAdmin=new SPAIAdmin;